import React from "react";

function Register() {
  return (
    <div className="register">
      <form className="columns-1 cursor-row-resize">
        <input type="text" />
        <input type="email" />
        <input type="password" />
        <input type="password" />
        <input type="submit" />
      </form>
    </div>
  );
}

export default Register;
